import React, { useState, useEffect } from 'react';

const OpenAIManager = () => {
  const [openaiKeys, setOpenaiKeys] = useState([]);
  const [selectedKey, setSelectedKey] = useState('');
  const [newKeyName, setNewKeyName] = useState('');
  const [newKeyValue, setNewKeyValue] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // OpenAI ÌÇ§ Î™©Î°ù Í∞ÄÏ†∏Ïò§Í∏∞
  const fetchOpenAIKeys = async () => {
    setLoading(true);
    try {
      const response = await fetch('/openai');
      if (response.ok) {
        const html = await response.text();
        // HTMLÏóêÏÑú ÌÇ§ Ï†ïÎ≥¥Î•º ÌååÏã± (Ïã§Ï†úÎ°úÎäî API ÏóîÎìúÌè¨Ïù∏Ìä∏Í∞Ä ÌïÑÏöî)
        // ÏûÑÏãúÎ°ú ÏÑ∏ÏÖòÏä§ÌÜ†Î¶¨ÏßÄÏóêÏÑú Í∞ÄÏ†∏Ïò§Í∏∞
        const keys = JSON.parse(localStorage.getItem('openai_keys') || '[]');
        const selected = localStorage.getItem('openai_selected') || '';
        setOpenaiKeys(keys);
        setSelectedKey(selected);
      }
    } catch (error) {
      console.error('OpenAI ÌÇ§ Î™©Î°ù Í∞ÄÏ†∏Ïò§Í∏∞ Ïã§Ìå®:', error);
    } finally {
      setLoading(false);
    }
  };

  // ÌÇ§ Ï∂îÍ∞Ä
  const handleAddKey = async (e) => {
    e.preventDefault();
    if (!newKeyName.trim() || !newKeyValue.trim()) {
      setError('ÌÇ§ Ïù¥Î¶ÑÍ≥º Í∞íÏùÄ ÌïÑÏàòÏûÖÎãàÎã§.');
      return;
    }

    setLoading(true);
    try {
      const formData = new FormData();
      formData.append('name', newKeyName);
      formData.append('key', newKeyValue);

      const response = await fetch('/openai', {
        method: 'POST',
        body: formData
      });

      if (response.ok) {
        const newKey = { name: newKeyName, key: newKeyValue };
        const updatedKeys = [...openaiKeys, newKey];
        setOpenaiKeys(updatedKeys);
        localStorage.setItem('openai_keys', JSON.stringify(updatedKeys));

        setNewKeyName('');
        setNewKeyValue('');
        setSuccess('OpenAI API ÌÇ§Í∞Ä ÏÑ±Í≥µÏ†ÅÏúºÎ°ú Ï∂îÍ∞ÄÎêòÏóàÏäµÎãàÎã§.');
        setError('');
      } else {
        setError('ÌÇ§ Ï∂îÍ∞ÄÏóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
      }
    } catch (error) {
      setError('ÌÇ§ Ï∂îÍ∞Ä Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.');
    } finally {
      setLoading(false);
    }
  };

  // ÌÇ§ ÏÑ†ÌÉù
  const handleSelectKey = async (keyName) => {
    setLoading(true);
    try {
      const formData = new FormData();
      formData.append('name', keyName);

      const response = await fetch('/openai/select', {
        method: 'POST',
        body: formData
      });

      if (response.ok) {
        setSelectedKey(keyName);
        localStorage.setItem('openai_selected', keyName);
        setSuccess('OpenAI API ÌÇ§Í∞Ä ÏÑ†ÌÉùÎêòÏóàÏäµÎãàÎã§.');
        setError('');
      } else {
        setError('ÌÇ§ ÏÑ†ÌÉùÏóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
      }
    } catch (error) {
      setError('ÌÇ§ ÏÑ†ÌÉù Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.');
    } finally {
      setLoading(false);
    }
  };

  // ÌÇ§ ÏÇ≠Ï†ú
  const handleDeleteKey = async (keyName) => {
    if (!confirm(`Ï†ïÎßêÎ°ú "${keyName}" ÌÇ§Î•º ÏÇ≠Ï†úÌïòÏãúÍ≤†ÏäµÎãàÍπå?`)) {
      return;
    }

    setLoading(true);
    try {
      const formData = new FormData();
      formData.append('name', keyName);

      const response = await fetch('/openai/delete', {
        method: 'POST',
        body: formData
      });

      if (response.ok) {
        const updatedKeys = openaiKeys.filter(key => key.name !== keyName);
        setOpenaiKeys(updatedKeys);
        localStorage.setItem('openai_keys', JSON.stringify(updatedKeys));

        if (selectedKey === keyName) {
          setSelectedKey('');
          localStorage.removeItem('openai_selected');
        }

        setSuccess('OpenAI API ÌÇ§Í∞Ä ÏÇ≠Ï†úÎêòÏóàÏäµÎãàÎã§.');
        setError('');
      } else {
        setError('ÌÇ§ ÏÇ≠Ï†úÏóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
      }
    } catch (error) {
      setError('ÌÇ§ ÏÇ≠Ï†ú Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.');
    } finally {
      setLoading(false);
    }
  };

  // ÌÇ§ ÎßàÏä§ÌÇπ Ìï®Ïàò
  const maskKey = (key) => {
    if (key.length < 8) return '*'.repeat(key.length);
